import React from "react";
import styled from "styled-components";
import { Img, Grid, Timer } from "arclight-react";

const Select = styled.div``;

const _Title = styled.div`
  color: #dfdfdf;
  margin-top: 15px;
  & table {
    border-spacing: 20px 0;
  }
`;

const Container = styled.div`
  height: calc(100% - 33.5px);
`;

const Item = styled.div`
  position: relative;
  width: 100%;
  color: #e0e0e0 & img {
    width: 100%;
    border-radius: 3px;
    cursor: pointer;
  }
  .sub {
    position: absolute;
    width: 100%;
    bottom: 0;
    right: 0;
    background-image: linear-gradient(to top, #000000, rgba(255, 255, 255, 0));
    border-radius: 3px;
    text-align: right;
    .text {
      margin: 3px;
    }
  }
  .roles {
    position: absolute;
    top: 0;
    left: 0;
    display: inline-flex;
    & img {
      width: 20px;
      border-radius: 50%;
      margin: 2px;
    }
  }
`;

const TEMP = () => {
  const arr = [];
  for (let i = 0; i < 150; i++) {
    arr.push(
      <Item>
        <Img src={require("../img/yone_square.jpg")} />
        <div className={"roles"}>
          <Img src={require("../../../config/assets/fighter.png")} />
          <Img src={require("../../../config/assets/mage.png")} />
        </div>
        <div className={"sub"}>
          <div className={"text"}>Heimerdinger</div>
        </div>
      </Item>
    );
  }
  return arr;
};

export default class _ extends React.Component {
  render() {
    return (
      <div style={{ width: "inherit", height: "inherit" }}>
        <_Title>
          <table>
            <tbody>
              <tr>
                <td>
                  <Timer
                    theme={this.props.STATE.config.THEME}
                    isPlaying={false}
                    size={75}
                    seconds={60}
                    crit={7}
                    strokeWidth={3}
                    onComplete={() => console.log("Timer Finished")}
                  />
                </td>
                <td>
                  <h1>
                    <b>
                      <i>Ban Phase</i>
                    </b>
                  </h1>
                </td>
              </tr>
            </tbody>
          </table>
        </_Title>
        <Container>
          <Grid
            theme={"Dark"}
            search={true}
            itemsPerRow={8}
            height={"100%"}
            filtersRight
            filters={[
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.FIGHTER} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.MAGE} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.MARKSMAN} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.ASSASSIN} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.TANK} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
              {
                display: (
                  <Img src={this.props.STATE.config.MODAL.SEARCH.SUPPORT} />
                ),
                active: true,
                onClick: (filter) => console.log(filter.active),
              },
            ]}
            items={TEMP()}
          />
        </Container>
      </div>
    );
  }
}
